    "Multifunctional Erosion Resistant Icephobic Appliqu?s for Rotorblades Project",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:42:13.744262",nt"name": "multifunctional-erosion-resistant-icephobic-appliqus-for-rotorblades-project",nt"isopen":
    true,nt"url": null,nt"notes": "The purpose of this Phase I NASA SBIR program
    is to develop highnperformance multifunctional nanostructured materials that can
    be used tonfabricate icephobic multifunctional appliqus with enhanced erosionnresistance
    for rotorcraft leading edges.  The proposed technology offersnintegrated multifunctionality
    that results in reduction of weight,nsystem complexity, maintenance, and cost over
    current systems.nPrevention of ice buildup will facilitate mission critical operations
    innicing conditions, as well as mitigate concerns of vibration transmissionnand
    shudder that are associated with ice buildup.  Integration ofnadditional erosion
    resistant composites may also result in reducednmaintenance costs.   Electrothermal
    systems are currently used fornanti-icing systems in rotorcraft, but are prone to
    failure due to systemncomplexity.  To mitigate the problems associated with current
    anti-icingnsystems, NanoSonic proposes to develop multifunctional adhesive backednappliqus
    with integrated hydrophobicity and enhanced erosion resistance.nHigh performance
    tapes are currently applied to rotorcraft leading edgesnto help improve erosion
    resistance.  Integrating multiplenfunctionalities into a high performance nanocomposite
    appliqu wouldnresult in reduction of weight and system complexity, facilitatenoperation
    in icing conditions, and reduce maintenance on thenrotorblades.  For minimal maintenance
    and application cost, a newnappliqu can be readily placed on the rotorblade leading
    edge when thenexisting appliqu has exhausted its functionality.",nt"license_title":
